from functools import reduce


def stringTask2(str):
    if 0 <= len(str) <= 10 ** 5:
        out = ''
        for i in str:
            if i in ["A", "O", "Y", "E", "U", "I", "a", "o", "y", "e", "u", "i"]:
                continue
            elif i.isupper():
                c = i.lower()
                out += c
            else:
                out += i
        a = '.'.join(out)
        a = '.' + a[:]
        print(a)
        return a
    else:
        exit()


def fun_game_1(n):
    if 1 <= n <= 10 ** 9 and type(n) == int:
        x = [i for i in range(1, n + 1)]
        sum_ = 0
        tr = 0
        for i in range(n):
            if i != 0:
                sum_ += x[i]
                tr -= x[i]
            else:
                sum_ += x[i]
                tr += x[i]
        if sum_ % 2 == 0 and tr % 2 == 0:
            return True
        else:
            return False
    else:
        exit()


def buyingCakes(cakes, prices):
    check = len(cakes) <= 10 ** 5 and len(cakes) == len(prices)
    for i in cakes:
        if 1 <= len(i) <= 10:
            check = check and True
        else:
            check = check and False
            break
    for i in prices:
        if 1 <= i <= 10 ** 9:
            check = check and True
        else:
            check = check and False
            break
    if check:
        id2 = []
        id1 = []
        sum_ = []
        for i in range(len(cakes)):
            for j in range(len(cakes)):
                if i != j:
                    a = list(set(cakes[i] + cakes[j]))
                    if reduce(lambda x, y: x + y, a) == 55:
                        id2.append(i)
                        id1.append(j)
                else:
                    continue
        for i in range(len(id1)):
            sum_.append(prices[id2[i]] + prices[id1[i]])
        if sum_:
            sum_.sort()
            return sum_[0]
        else:
            return -1
    else:
        exit()


